.text

main:
	la $a0,A16
	la $a1,B16
	la $a2,C
	li $a3,16	# set N the matrix size
	jal MADD1

	la $a0,C
	la $a1,C16
	li $a2,16
	jal check	# check the answer

	li $v0, 10      # load exit call code 10 into $v0
        syscall         # call operating system to exit	

MADD1:  #( float* A, float* B, float* C, int N )
        # TODO
        # $t0 = i
        # $t1 = j
        # $t2 = k
        # $t3 offset of c when storing
        # $t4 offset of a
        # $t5 offset of b
        # $t6 offset of c when loading 
        
        # int i = 0
        li $t0, 0


CloopMADD1:
        bge $t0, $a3, MADD1done
        
        # int j = 0
        li $t1, 0

AloopMADD1:
        bge $t1, $a3, AloopMADD1done

        # int k = 0
        li $t2, 0

        # clear $f4/ c(i,j) temp var
        mtc1 $zero, $f4

BloopMADD1:
        bge $t2, $a3, BloopMADD1done

        # load c(j,k) into $f4
        mul $t6, $t1, $a3
        add $t6, $t6, $t2
        sll $t6, $t6, 2
        add $t6, $t6, $a2

        lwc1 $f4, 0($t6)


        # c(j,k) = $f4
        # address c(j,k) = $t3
        # c(j,k) = c(j,k) + a(j,i) * b(i,k)
        # a(j,i) = $f6
        # address a(j,i) = $t4
        mul $t4, $t1, $a3
        add $t4, $t4, $t0
        sll $t4, $t4, 2
        add $t4, $t4, $a0

        lwc1 $f6, 0($t4)

        # address b(i,k) = $t5
        mul $t5, $t0, $a3
        add $t5, $t5, $t2
        sll $t5, $t5, 2
        add $t5, $t5, $a1

        lwc1 $f8, 0($t5)

        mul.s $f10, $f6, $f8

        add.s $f4, $f4, $f10
        
        # load c(j,k) into memory
        mul $t3, $t1, $a3
        add $t3, $t3, $t2
        sll $t3, $t3, 2
        add $t3, $t3, $a2
        swc1 $f4, 0($t3)
        
        # k++
        add $t2, $t2, 1
        j BloopMADD1
    
BloopMADD1done:

        # j++
        add $t1, $t1, 1

        j AloopMADD1
        
AloopMADD1done:
        # i++
        add $t0, $t0, 1
        j CloopMADD1

MADD1done:
        jr $ra

check: 				#( float* C, float* CAnswer, int N )
	mul $t0,$a2,$a2
	sll $t0,$t0,2
	add $t0,$t0,$a0         # next address beyond the end of C, to use in loop
	mtc1 $zero, $f12	# $f12 will be the Frobenious norm of the difference
cloop:	beq $a0,$t0 cdone
        lwc1 $f4,0($a0)
        lwc1 $f6,0($a1)
        sub.s $f6,$f4,$f6
        mul.s $f6,$f6,$f6
        add.s $f12,$f12,$f6	# add the sum of squares        
        addi $a0,$a0,4
        addi $a1,$a1,4
        j cloop
cdone:	li $v0, 2       	# print float in $f12
	syscall
        jr $ra
                
